import './App.css';

function App() {
  function nomeCompleto(props){
    return props.nome + " " + props.sobrenome;
  }
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello, world!</h1>
        {nomeCompleto({nome: "Genilson", sobrenome: "Silva"})}

      </header>
    </div>
  );
}

export default App;
